    width: 100%;
    max-width: 300px;
    height: 43px;
    padding: 5px 10px;
    border: 1px solid rgba(0, 0, 0, 0.3);
    border-radius: 10px;
    display: flex;
    align-items: center;
}

.find-input {
    width: 100%;
    height: 100%;
}

