    width: 25px;
    height: 25px;
    cursor: pointer;
}

.numbers {
    display: flex;
    flex-direction: column;
    align-items: center;
    gap: 10px;
}

.tel {
    display: block;
    font-family: 'Roboto Flex', 'Inter';
    font-style: normal;
    font-weight: 500;
    font-size: 18px;
    line-height: 21px;
    /* identical to box height */

    text-align: center;

    /* 70% */

    color: rgba(0, 0, 0, 0.7);
}

.link-tel {
    font-style: normal;
    font-weight: 500;
    font-size: 15px;
    line-height: 18px;
    letter-spacing: 0.02em;
    text-decoration-line: underline;
    text-transform: uppercase;

    color: #000000;
}

